#![feature(io_error_more)] use std::env;
use std::fs;
use std::io::ErrorKind;
use std::path; #[derive(Debug)]
pub struct Config { query: String, filename: String, conf: Vec<String>,
} impl Config { pub fn new() -> Result<Self, String> { let args = env::args().collect::<Vec<_>>(); if args.len() < 3 { Err(format!("no enough arguments\n{}", print_help())) } else { let conf = args .iter() .filter(|&s| s.starts_with("-")) .map(|s| s.clone()) .collect::<Vec<_>>(); let args = args .iter() .filter(|&s| !(conf.contains(s) || s == &args[0])) .take(2) .collect::<Vec<_>>(); Ok(Config { query: args[0].clone(), filename: args[1].clone(), conf, }) } } pub fn get_file(&self) -> &String { &self.filename } pub fn get_query(&self) -> &String { &self.query } pub fn get_conf(&self) -> &Vec<String> { &self.conf }
} pub fn print_help() -> String { format!( "\n{}\n{}\n{}\n{}\n{}\n", "Usage: learn_rs <text> <file> [<args>]", "available args:", " `-h` or `--help`: print this message", " `-c` or `--case`: case sensitive (default)", " `-i` or `--insensitive`: case insensitive" )
} pub fn run(config: Config) -> Result<(), ErrorKind> { let available_configs = vec!["-h", "--help", "-c", "--case", "-i", "--insensitive"]; if config .get_conf() .iter() .filter(|&s| !available_configs.contains(&s.as_str())) .count() > 0 { // check invalid config Err(ErrorKind::InvalidInput) } else if config.get_conf().contains(&"-h".to_string()) || config.get_conf().contains(&"-help".to_string()) { // get helps Ok(println!("{}", print_help())) } else if path::Path::new(config.get_file()).exists() { // find pattern let contents = fs::read_to_string(config.get_file()).unwrap(); if config.get_conf().contains(&"-i".to_string()) || config.get_conf().contains(&"--insensitive".to_string()) { Ok(search_insensitive(config.get_query(), &contents) .iter() .for_each(|&s| println!("{}", s))) } else { Ok(search(config.get_query(), &contents) .iter() .for_each(|&s| println!("{}", s))) } } else { Err(ErrorKind::InvalidFilename) }
} pub fn search<'a>(query: &str, contents: &'a str) -> Vec<&'a str> { contents .lines() .filter(|&s| s.contains(query)) .collect::<Vec<_>>()
} pub fn search_insensitive<'a>(query: &str, contents: &'a str) -> Vec<&'a str> { contents .lines() .filter(|&s| s.to_lowercase().contains(&query.to_lowercase())) .collect::<Vec<_>>()
} /// main.rs
use learn_rust::{print_help, run, Config};
use std::process; fn main() { let conf = Config::new().unwrap_or_else(|err| { eprintln!("\n>> Initializion Failed: `{}`\n", err); process::exit(1); }); if let Err(e) = run(conf) { eprintln!("\n>> Runtime Error: `{}`\n", e); println!("{}", print_help()); process::exit(1); }
}

